import { Button } from 'antd'
import React, { useState, useEffect } from 'react'
import { RealtimeData_Request } from '../../api'
import { C3Model, G2Model } from '../../DataRequest/DataModel'
import { DataMapping, DataSortRT } from '../../DataRequest/RealTimeRequestWrap'
import HMIWrapper from '../Realtime/HMIWrapper'
import PolymerC3 from './HMI/PolymerC3'
import PolymerG2 from './HMI/PolymerG2'

let C3DataModel = C3Model
let G2DataModel = G2Model

let RealTimeValue = {
    "R1": C3DataModel,
    "R2": G2DataModel,
    "R3": {},
    "R4": {}
}

const Line1RT = () => {

    const [Refresh, setRefresh] = useState(false)

    const DataRequest = async (label, site, page, line, BufferName) => {
        const response = await RealtimeData_Request(label, site, page, line)
        RealTimeValue[BufferName] = DataSortRT(response)
    }

    const test = () => {
        DataRequest([], 'Polymerlink', '1', 'C3', 'R1')

        DataRequest([], 'Polymerlink', [], 'G2', 'R2')

        //console.log(RealTimeValue['R2']);
        setRefresh(!Refresh)
    }




    return (
        <div>
            {console.log('render')}
            <Button onClick={test}> Test R</Button>

            <div>
                <HMIWrapper>
                    <PolymerC3 key={'C3'} Parameter={RealTimeValue['R1']} />
                    <PolymerG2 key={'G2'} />
                    <h3>asdasda</h3>
                </HMIWrapper>
            </div>

        </div>
    )
}

export default Line1RT
